//deprecated
// df.registerTempTable("houses")

//use this instead
df02.createOrReplaceTempView("houses")

import org.apache.spark.sql.types.{StructField, IntegerType}// corresponding to SQL schema
// import spark.implicits._

val fields = df02.schema.fields.collect{
    case StructField(name, IntegerType, _, _) => name //extract the Column name if it's an integer type
}


val correlations = df02.select(fields.map(corr(_, "SalePrice")):_*).first.toSeq.asInstanceOf[Seq[Double]]// ToDo: need to refactor this

val t2 = fields zip correlations
val df_T2 = spark.createDataFrame(t2)// Doesn't accept a Seq[Any]!!! Error was: java.lang.UnsupportedOperationException: Schema for type Any is not supported

z.show(df_T2)

